{"product_url": "http://us.asos.com/ELLESSE/Ellesse-Cuffed-Sweatpants/Prod/pgeproduct.aspx?cid=14274&clr=Grey&iid=4537483&pge=0&pgesize=36&sh=0&sort=-1", "source_site": "asos.com", "description": ["Sweat pants", " by ", "Ellesse", "    ", "Soft-touch jersey sweat fabric", "    ", "Shirred waistband with drawstring", "    ", "Side slant pockets", "    ", "Signature branding print to leg", "    ", "Tapered fit - cut loosely around the thigh and tapered from the knee to the ankle", "    ", "Machine wash", "    ", "80% Cotton, 20% Polyester", "    ", "Our model wears a size Medium and is 188cm/6'2\" tall", "ABOUT ELLESSE", "When Leonardo Servadio couldn't find what he wanted to wear on the slopes, he made it. Channelling his charismatic personality and tailoring skills into his first streetwear collection, the Italian label ", "Ellesse", " - named after his initials L&S, obviously - was born in 1959. Now, sweatpants, track jackets and T-shirts are all stamped with the iconic ", "Ellesse", " logo."], "image_urls": ["http://images.asos-media.com/inv/media/3/8/4/7/4537483/grey/image1xl.jpg"], "product_item_num": "4537483", "list_price": "$66.65", "product_title": "Ellesse Cuffed Sweatpants"}
